INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Doug Jones', '1960-05-24', 'Indianapolis, Indiana, USA', 'nm0427964', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMTYzNDY4MDc0OF5BMl5BanBnXkFtZTYwODM4MDY0._V1_.jpg', 'The youngest of four brothers, Doug Jones was born on the 24th May, 1960, in Indianapolis, Indiana, and grew up in the city\'s Northeastside. After attending Bishop Chatard High School, he headed off to Ball State University, where he graduated in 1982 with a Bachelor\'s degree in Telecommunications, with a minor in Theatre.');
INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Michael Trucco', '1970-06-22', 'San Mateo, California, USA', 'nm0873998', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMTUyNjM2ODQ1Ml5BMl5BanBnXkFtZTgwNTkzOTA1MTE@._V1_.jpg', 'Born and raised in San Mateo , California, he graduated from Santa Clara University with a BA in Theatre Arts and was quickly headed to Los Angeles to pursue his dream of a career in Film and Television. He didn\'t have to wait long. A recurring role on "BEVERLY HILLS 90210" brought Michael the recognition he sought and he followed that with a starring role on the CBS Series "PENSACOLA: WINGS OF GOLD" opposite James Brolin for two seasons.');
