INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Faye Dunaway', '1941-01-14', 'Bascom, Florida, USA', 'nm0001159', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMTk4OTU5MDY0OV5BMl5BanBnXkFtZTYwNTc0MTM1._V1_.jpg', 'Faye Dunaway was born on a farm in Bascom, Florida in 1941, the daughter of Grace April (Smith), a housewife, and John MacDowell Dunaway, Jr., an army officer. After high school she majored in education at the University of Florida, but switched to theatre arts and transferred to Boston University, earning her degree in 1962.');
INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Carrie-Anne Moss', '1967-08-21', 'Vancouver, British Columbia, Canada', 'nm0005251', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMTYxMjgwNzEwOF5BMl5BanBnXkFtZTcwNTQ0NzI5Ng@@._V1_.jpg', 'Carrie-Anne Moss was born on August 21, 1967, in Vancouver, British Columbia, as youngest of two children of Barbara and Melvyn Moss. At age 20, she moved to Europe to pursue a career in modeling; in Spain she was cast in a regular role in the TV show "Dark Justice", which was produced in Barcelona for its first season, and she followed it to the shooting locations in Los Angeles the next year.');
INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Leigh Whannell', '1977-01-17', 'Melbourne, Victoria, Australia', 'nm1191481', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMTkyMzA3OTI0Ml5BMl5BanBnXkFtZTcwNDUzMTEzMQ@@._V1_.jpg', 'Leigh Whannell grew up in Melbourne, Australia, where, at the age of four, he developed an obsession with telling stories. Whether it be through acting, writing or filmmaking, his primary love was getting a reaction from an audience. In 1995, at the age of 18, he was accepted into the Royal Melbourne Institute of Technology\'s prestigious Media Arts course, where he met fellow filmmaker James Wan.');
