INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Seth William Meier', '1974-08-30', '', 'nm0576720', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMjA3MjUxMjcwMV5BMl5BanBnXkFtZTgwOTk4MDEwMTE@._V1_.jpg', 'Seth William Meier started his career in acting with a simple twist of fate. At a young age, Meier was obsessed with drawing and painting and kept rather odd pen pals, by drawing back and forth with a few of the founding fathers of Walt Disney Animation: Ollie Johnston, Frank Thomas and Ward Kimball.');
INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Patrick Murray', 'Unknown', '', 'nm4039059', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/medium/name-2135195744._CB522736367_.png', 'Patrick Murray has been in the entertainment and financial services industries for over 30 years, with broad experience in finance, business affairs, production, distribution, strategic planning and investment banking in the film, television and related media industries.');
