INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Robert Simonds', 'Unknown', 'Phoenix, Arizona, USA', 'nm0800465', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMTYzNTcyNDMyOF5BMl5BanBnXkFtZTgwMTU4NzAwOTE@._V1_.jpg', 'Robert Simonds is one of Hollywood\'s most profitable and prolific producers of motion pictures. His over thirty studio movies have generated well in excess of $6 billion in worldwide revenue and include some of the biggest star-driven hits of the last decade, such as "Cheaper by the Dozen" and "The Pink Panther" with Steve Martin, "Big Daddy" and "The Waterboy" with Adam Sandler, and "This Means War" with Reese Witherspoon and Tom Hardy.');
