INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Donald Tang', 'Unknown', '', 'nm4719619', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/medium/name-2135195744._CB522736367_.png', 'Donald Tang is an American businessman and senior entertainment industry leader. He is founding partner of Tang Media Partners. Prior to his current position, he served as Vice Chairman, Bear, Stearns & Co. Inc., and Chairman of Bear Stearns Asia.He was born in Shanghai, China where his parents were college professors.');
