INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Jason Rody', '1971-06-27', 'Savannah, Georgia, USA', 'nm1157649', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/medium/name-2135195744._CB522736367_.png', 'Other than assistant directing, Rowdy has been writing screenplays for many years. While he writes, he preps for the end of the Mayan calendar and seeks representation for his Post-Apocalyptic Fixer series. His favorite films include Do The Right Thing, Down By Law, The Goonies, Amelie, and Super 8.');
