INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Christina Lambert', 'Unknown', '', 'nm4949788', 'https://images-na.ssl-images-amazon.com/images/M/MV5BZmE0M2RjMjgtYmVlOS00ZTllLTkyODgtNDFhZmMwYTNhOTEwL2ltYWdlXkEyXkFqcGdeQXVyNjAzMTgyMDY@._V1_.jpg', 'Born in Rome, NY, the daughter of an Air Force Colonel, Christina, moved across the states from California to Ohio. Her acting and modeling career grew more in later years, though her passion for it goes back to early childhood. Being involved behind the camera as draper and set dresser on movies such as Carol (Cate Blanchett), Miles Ahead (Don Cheadle) and The Blunderer (Jessica Biel) only continued to fuel her drive to be on screen.');
