INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Brenden Meers', '1991-03-11', 'Columbus, Ohio, USA', 'nm2370270', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMTY1OTc5MDgzN15BMl5BanBnXkFtZTgwMTU3MzEyODE@._V1_.jpg', 'Brenden Meers was born Brenden Meers Smith. He was raised by his Mother, Angella Smith. His enjoyment of movies, and imitating characters from movies, made his choice to start a career in acting a natural one. In the summer of 2004, at the age of 13, he landed his first role in "Beowulf: Prince of the Geats," playing a Norse warrior.');
